function Print(props) {
  return (
    <div>
      <input type="range" name="sdsd" min={0} max={10}></input>
      {props.children}
    </div>
  );
}
function Print3() {
  return (
    <Print>
      <h1>ikjkjkj</h1>
    </Print>
  );
}
function Print2() {
  return (
    <div>
      <Print></Print>
      <Print3></Print3>
    </div>
  );
}

export { Print, Print2 };
